%[text] %[text:anchor:H_E72C35C8] ## Modulo Operation
%[text] The function **mod** returns the remainder after division
%[text] **Consider** ***a***
a = 1:10
%[text] What are the remainders after dividing by 2?
remainders = mod(a,2)
%[text] After dividing by 3?
mod(a,3)
%[text] - do you see any patterns? \
%[text] **Now, consider** ***b:***
b = 0:0.25:2

%[text] What are the remainders after dividing by 1?
