%[text] %[text:anchor:H_320CD45D] ### Magic Matrices
%[text] %[text:anchor:H_D23CC66C] What is a magic square?
%[text] Consider ***m***
m = magic(6)
%[text] - *m* is a magic square
%[text] - Its a square because it has the same number of rows as columns \
%[text] But, what makes it magic? 
%[text] To find out…
%[text] - Add up all of the columns (the sum for each column )
%[text] - And the rows (the sum for each row)
%[text] - And the diagonal (use the function **diag** to get the diagonal values and then sum) \
%[text]  

