%[text] %[text:anchor:H_308C73C2] ### Linear Algebra is happening
%[text] The default matrix math operation for multiplication and division is linear algebra. So, when you multiply two matrices together, you get a result that makes sense only if you understand Linear. Fortunately, we are not learning Linear Algebra in this class. So, we don't have to understand why we get the results that we are getting. 
%[text] However, sometimes, you want to multiply two matrices, element-by-element. 
%[text] How do you do that?
%[text] Read on, Dear reader. Read on.
